import React from "react";
import { reviews } from "../constants/index";
import Review from "./Review";

const Reviews = () => {
  return (
    <div className="review-wrapper">
      {reviews.map(review => (
        <Review key={review.id} {...reviews}>
          {review.comment}
        </Review>
      ))}
    </div>
  );
};

export default Reviews;
